export class LedgerDetail {
    name: string
    currency: number
    isCredit: boolean
    description: string
    createdAt: string

    constructor(name: string, currency: number, isCredit: boolean, description: string, createdAt: string) {
        this.name = name;
        this.currency = currency;
        this.isCredit = isCredit;
        this.description = description;
        this.createdAt = createdAt;
    }
}
